  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains the Finding of No
  Significant Impact (FONSI) and the Environmental Assessment (EA) for the Ottawa
  NWR Fire Management Plan. A description of the burning program is provided. Environmental
  impacts are discussed; these include water quality, air quality, wildlife, archeology,
  and energy use. Alternatives to prescribed burning, such as discing, flooding, biological
  control, chemical control, and no action, are summarized. A list of prescribed burning
  units is provided. Wildfire suppression is also described. An emergency plan for
  firefighters is attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
